import React from 'react'
import {Paper} from '@material-ui/core'

class Register extends React.Component{
    render(){
        return(
            <div className="container mt-5">
                <div className='row justify-content-center'>
                    <div className="col-md-8">
                        <Paper className="p-5">
                            <h1>Sign In</h1>
                            <input type="text" className="form-control mt-3" placeholder="your username"></input>
                            <input type="text" className="form-control mt-3" placeholder="your password"></input>
                            <input type="text" className="form-control mt-3" placeholder="confirm password"></input>

                        </Paper>
                    </div>
                </div>
            </div>
        )
    }
}

export default Register;
